INSERT INTO `v1_75329ac25c60f1e6ab7b07e35bdcdc32615cc1d96a0349050082a8f8467b4d37` VALUES (1, -416.5, 1000001, 0.0, 190804, 3.414, "カリン", 2, "ミッションをクリアすると、\n報酬がもらえますよ！\n頑張ってください", 1, "2030/01/01 14:59:59", 62, 1, "2025/01/31 12:00:00");
INSERT INTO `v1_75329ac25c60f1e6ab7b07e35bdcdc32615cc1d96a0349050082a8f8467b4d37` VALUES (2, -416.5, 1000002, 0.0, 190804, 3.099, "カリン", 2, "ミッションをクリアして、\n報酬をゲットしましょう！", 1, "2030/01/01 14:59:59", 62, 1, "2025/01/31 12:00:00");
INSERT INTO `v1_75329ac25c60f1e6ab7b07e35bdcdc32615cc1d96a0349050082a8f8467b4d37` VALUES (3, -416.5, 1000003, 0.0, 190804, 2.801, "カリン", 2, "受け取ることができる\n報酬があるようです\n確認してみてください", 1, "2030/01/01 14:59:59", 63, 1, "2025/01/31 12:00:00");
INSERT INTO `v1_75329ac25c60f1e6ab7b07e35bdcdc32615cc1d96a0349050082a8f8467b4d37` VALUES (4, -416.5, 1000004, 0.0, 190804, 0.0, "カリン", 2, "報酬がもらえますよ！\nチェックしてみてください", 1, "2030/01/01 14:59:59", 63, 2, "2025/01/31 12:00:00");
INSERT INTO `v1_75329ac25c60f1e6ab7b07e35bdcdc32615cc1d96a0349050082a8f8467b4d37` VALUES (5, -363.0, 1000005, 0.0, 190804, 2.12, "カリン", 1, "ギルド管理協会です！\nイベント報酬券をお持ちでしたら、様々なアイテムと交換できますよ", 1, "2030/01/01 14:59:59", 64, 2, "2025/01/31 12:00:00");
INSERT INTO `v1_75329ac25c60f1e6ab7b07e35bdcdc32615cc1d96a0349050082a8f8467b4d37` VALUES (6, -363.0, 1000006, 0.0, 190804, 1.68, "カリン", 2, "お疲れさまです！\nこちらでイベント報酬券とアイテムを交換することができますよ", 1, "2030/01/01 14:59:59", 64, 1, "2025/01/31 12:00:00");
INSERT INTO `v1_75329ac25c60f1e6ab7b07e35bdcdc32615cc1d96a0349050082a8f8467b4d37` VALUES (7, -363.0, 1000007, 0.0, 190804, 2.33, "カリン", 1, "いつもありがとうございます！\n報酬交換ですか？\nでは、イベント報酬券とお引き換えいたしますね", 1, "2030/01/01 14:59:59", 64, 2, "2025/01/31 12:00:00");
INSERT INTO `v1_75329ac25c60f1e6ab7b07e35bdcdc32615cc1d96a0349050082a8f8467b4d37` VALUES (101, -285.0, 1020101, -6.0, 133701, 5.18, "ラビリスタ", 7, "今度の敵は、アタシにとっても\n放ってはおけない存在だ\n少年、アタシも全力で行くからさ\n一緒に守ろう、この世界を", 10201, "2030/01/01 14:59:59", 61, 3, "2025/01/31 12:00:00");
INSERT INTO `v1_75329ac25c60f1e6ab7b07e35bdcdc32615cc1d96a0349050082a8f8467b4d37` VALUES (201, -285.0, 1020102, -2.0, 133901, 8.77, "クリスティーナ", 2, "退屈の吹き飛ぶような\n戦いの気配がするなぁ坊や\nさっさとワタシをそこへ連れてゆけ\n世界も守ってやるさ、ついでにな", 10201, "2030/01/01 14:59:59", 61, 1, "2025/01/31 12:00:00");
INSERT INTO `v1_75329ac25c60f1e6ab7b07e35bdcdc32615cc1d96a0349050082a8f8467b4d37` VALUES (301, -285.0, 1020103, 0.0, 133801, 15.5, "ネネカ", 1, "おや、私の力が必要……と？\nグレゴールが手伝うそうですよ\n私は戦わないのか、という顔ですね\n……考えておきます", 10201, "2030/01/01 14:59:59", 61, 6, "2025/01/31 12:00:00");
INSERT INTO `v1_75329ac25c60f1e6ab7b07e35bdcdc32615cc1d96a0349050082a8f8467b4d37` VALUES (101, -285.0, 1020201, 0.0, 134301, 9.061, "ランファ", 5, "わたしだけの歌…\n一緒に、探してくれる…？\nあなたがいれば…\nもっとがんばれるから…", 10202, "2030/01/01 14:59:59", 61, 2, "2025/02/28 12:00:00");
INSERT INTO `v1_75329ac25c60f1e6ab7b07e35bdcdc32615cc1d96a0349050082a8f8467b4d37` VALUES (201, -285.0, 1020202, 0.0, 134401, 7.699, "チカ", 2, "同じ唱喚士として、仲間として\n私にできることをします\n…これも、あなたが\n背中を押してくれたおかげですよ", 10202, "2030/01/01 14:59:59", 61, 1, "2025/02/28 12:00:00");
INSERT INTO `v1_75329ac25c60f1e6ab7b07e35bdcdc32615cc1d96a0349050082a8f8467b4d37` VALUES (101, -285.0, 1020301, 0.0, 134601, 8.595, "アオイ", 2, "世界の平和が私とクローチェさんに\nかかってるんですよね？\nぼっちには過大すぎる期待ですけど\nふ、二人でなら背負ってみせます！", 10203, "2030/01/01 14:59:59", 61, 1, "2025/03/31 12:00:00");
INSERT INTO `v1_75329ac25c60f1e6ab7b07e35bdcdc32615cc1d96a0349050082a8f8467b4d37` VALUES (201, -285.0, 1020302, 0.0, 134501, 7.758, "クローチェ", 2, "新しく手に入れたこの翼で…\nナイトさんがどこにいたって\nわたし、駆けつけちゃいますよっ！\nクローチェ・エアリアル発進ですっ", 10203, "2030/01/01 14:59:59", 61, 1, "2025/03/31 12:00:00");
INSERT INTO `v1_75329ac25c60f1e6ab7b07e35bdcdc32615cc1d96a0349050082a8f8467b4d37` VALUES (101, -285.0, 1020401, 0.0, 132302, 7.0, "ルイズマリー", 6, "今日はダーリンとの初デート♪\n二人でショッピングして、その後は\n…って私、指名手配されてる！？\nちょ、た…助けてダーリン～！！", 10204, "2030/01/01 14:59:59", 61, 2, "2025/04/30 12:00:00");
INSERT INTO `v1_75329ac25c60f1e6ab7b07e35bdcdc32615cc1d96a0349050082a8f8467b4d37` VALUES (201, -285.0, 1020402, 0.0, 132402, 7.904, "イロハ", 2, "ルイちゃんのおばあちゃん優しくて\nいつもにこにこで、イロハ大好き♪\nでも一番好きなのは、角がすっごく\n大きくてかっこいいとこなんだ～♪", 10204, "2030/01/01 14:59:59", 61, 1, "2025/04/30 12:00:00");
INSERT INTO `v1_75329ac25c60f1e6ab7b07e35bdcdc32615cc1d96a0349050082a8f8467b4d37` VALUES (301, -285.0, 1020403, 0.0, 132502, 8.487, "ソノ", 2, "ノゾミちゃんのおかげで売上が安定\nしてきたのに、臨時休業、痛すぎる\n…ま、ルイちゃんのために\n一肌脱ぐか。行くよイロハ～", 10204, "2030/01/01 14:59:59", 61, 4, "2025/04/30 12:00:00");
INSERT INTO `v1_75329ac25c60f1e6ab7b07e35bdcdc32615cc1d96a0349050082a8f8467b4d37` VALUES (101, -285.0, 1020502, 0.0, 134901, 8.763, "カノン", 2, "ヲ～ッホッホ♪\nあたくし様と同じお空気を吸える\nお幸運を噛みしめなさいですわ～♪\nヲ～ッホッホッホ～♪", 10205, "2030/01/01 14:59:59", 61, 1, "2025/05/31 12:00:00");
INSERT INTO `v1_75329ac25c60f1e6ab7b07e35bdcdc32615cc1d96a0349050082a8f8467b4d37` VALUES (201, -285.0, 1020503, 0.0, 134801, 6.417, "ツムギ", 3, "いきますよ騎士さん！\nカノンさんと力を合わせて…力を…\n…本当にあの人なんなんです？\nこれまでになく不安なんですけど！", 10205, "2030/01/01 14:59:59", 61, 1, "2025/05/31 12:00:00");
INSERT INTO `v1_75329ac25c60f1e6ab7b07e35bdcdc32615cc1d96a0349050082a8f8467b4d37` VALUES (101, -285.0, 1020601, 0.0, 135001, 10.335, "エリス", 7, "『願いが叶う海岸』か…怪しい\nだというのに、阿賀斗紫布菜たちは\n呑気に戯れている…見ていられない\n騎士クンは、わたしが守ってみせる", 10206, "2030/01/01 14:59:59", 61, 3, "2025/06/30 12:00:00");
INSERT INTO `v1_75329ac25c60f1e6ab7b07e35bdcdc32615cc1d96a0349050082a8f8467b4d37` VALUES (201, -285.0, 1020602, 0.0, 135101, 6.281, "シェフィ", 4, "せっかくの夏休みなんだし\nたまにはビーチでゆっくりしましょ\n…え、もしかしてこの夏もあんまり\n休めなかったりする感じなの？", 10206, "2030/01/01 14:59:59", 61, 2, "2025/06/30 12:00:00");
INSERT INTO `v1_75329ac25c60f1e6ab7b07e35bdcdc32615cc1d96a0349050082a8f8467b4d37` VALUES (301, -285.0, 1020603, 0.0, 135201, 12.244, "プレシア", 2, "いっぱい。たべて\nおおきく。なると\nせーぎ。まもれる。はず\nお兄。いっしょに。スイカ。たべよ", 10206, "2030/01/01 14:59:59", 61, 1, "2025/06/30 12:00:00");
INSERT INTO `v1_75329ac25c60f1e6ab7b07e35bdcdc32615cc1d96a0349050082a8f8467b4d37` VALUES (101, -285.0, 1020701, 0.0, 135301, 6.339, "クリア", 8, "ひと夏の冒険のはじまりです！\nアネモネさんも楽しんでくれたら\n…できれば、もう少し\n仲良くなれたらうれしいな…", 10207, "2030/01/01 14:59:59", 61, 2, "2025/07/31 12:00:00");
INSERT INTO `v1_75329ac25c60f1e6ab7b07e35bdcdc32615cc1d96a0349050082a8f8467b4d37` VALUES (201, -285.0, 1020702, 0.0, 135401, 8.184, "アネモネ", 9, "─幻の花…\n本当にあるのか謎─ですけど\n探すくらいは、\n付き合ってもいいです", 10207, "2030/01/01 14:59:59", 61, 7, "2025/07/31 12:00:00");
INSERT INTO `v1_75329ac25c60f1e6ab7b07e35bdcdc32615cc1d96a0349050082a8f8467b4d37` VALUES (101, -285.0, 1020801, 0.0, 129101, 3.906, "アイラ", 2, "あははっ！　笑う門には福来る！\n笑ってればきっと、複製世界にも\n未来はやってくるって信じてる！\nそうだよね、シナツちゃん！", 10208, "2030/01/01 14:59:59", 61, 9, "2025/08/31 12:00:00");
INSERT INTO `v1_75329ac25c60f1e6ab7b07e35bdcdc32615cc1d96a0349050082a8f8467b4d37` VALUES (201, -285.0, 1020802, 0.0, 129201, 14.465, "シナツ", 2, "繰り返されるリセットの先の未来\n何度願っても手に入らなかった未来\n…でも、私は諦めない。絶対にだ\nキミも同じだろ…アイラ？", 10208, "2030/01/01 14:59:59", 61, 1, "2025/08/31 12:00:00");
INSERT INTO `v1_75329ac25c60f1e6ab7b07e35bdcdc32615cc1d96a0349050082a8f8467b4d37` VALUES (301, -285.0, 1020803, 0.0, 100101, 8.662, "ヒヨリ", 3, "アイラの世界のみんなも、\n一生懸命生きてるんだ…！\n…なのに、世界の危機だなんて！\nあたし、絶対、絶対力になるよ！", 10208, "2030/01/01 14:59:59", 61, 4, "2025/08/31 12:00:00");
INSERT INTO `v1_75329ac25c60f1e6ab7b07e35bdcdc32615cc1d96a0349050082a8f8467b4d37` VALUES (401, -285.0, 1020804, 0.0, 100301, 10.915, "レイ", 3, "シナツ…もう一人の私\n彼女が大切にしている世界を\n絶対に終わらせはしない…！\n彼女と笑い合える未来のために！", 10208, "2030/01/01 14:59:59", 61, 1, "2025/08/31 12:00:00");
INSERT INTO `v1_75329ac25c60f1e6ab7b07e35bdcdc32615cc1d96a0349050082a8f8467b4d37` VALUES (101, -285.0, 1020901, 0.0, 135802, 6.042, "ユキノ", 7, "あ、ど、ども…\nあ、あんま見ねぇでくれっと\nその、恥ずかしくて…\n体が熱くなって、溶けちまう…", 10209, "2030/01/01 14:59:59", 61, 1, "2025/09/30 12:00:00");
INSERT INTO `v1_75329ac25c60f1e6ab7b07e35bdcdc32615cc1d96a0349050082a8f8467b4d37` VALUES (201, -285.0, 1020902, 0.0, 135903, 9.402, "サツキ", 1, "なんで俺が幽霊に…意味不明だ\nこれじゃ死んでも死にきれねェ\n悪ィがこれも何かの縁だ、\nよろしく頼むぜ騎士公", 10209, "2030/01/01 14:59:59", 61, 4, "2025/09/30 12:00:00");
INSERT INTO `v1_75329ac25c60f1e6ab7b07e35bdcdc32615cc1d96a0349050082a8f8467b4d37` VALUES (301, -285.0, 1020903, 0.0, 136902, 8.16, "ルルィ", 1, "う、うじゅる…\nサツキ姉しゃまを助けるためにも\nまずは、腹ごしらえでしゅね…！\nタコ焼き、召し上がってくだしゃい", 10209, "2030/01/01 14:59:59", 61, 8, "2025/09/30 12:00:00");
INSERT INTO `v1_75329ac25c60f1e6ab7b07e35bdcdc32615cc1d96a0349050082a8f8467b4d37` VALUES (101, -285.0, 1021001, 0.0, 137401, 5.0, "カスミ", 2, "ひさしぶりのジオ・ゲヘナ\n歓迎パーティーで起きた殺人事件！\nランドソルの名探偵の名にかけて\n解き明かしてみせようじゃないか！", 10210, "2030/01/01 14:59:59", 61, 3, "2025/10/31 12:00:00");
INSERT INTO `v1_75329ac25c60f1e6ab7b07e35bdcdc32615cc1d96a0349050082a8f8467b4d37` VALUES (201, -285.0, 1021002, 0.0, 136001, 8.12, "アラクネ", 1, "…わたしはどこの誰なのでしょう\nどこから来てどこへ行くのでしょう\nこの事件の真相が分かれば、\n何かが掴めるような気がいたします", 10210, "2030/01/01 14:59:59", 61, 4, "2025/10/31 12:00:00");
INSERT INTO `v1_75329ac25c60f1e6ab7b07e35bdcdc32615cc1d96a0349050082a8f8467b4d37` VALUES (301, -285.0, 1021003, 0.0, 136202, 6.386, "ナーナ", 2, "ナーナ、すいりとかろんぱとか、\nむずかしくてわかんないけど…\nお友だちとドーナツのためならっ\nせーいっぱいがんばるよっ！", 10210, "2030/01/01 14:59:59", 61, 4, "2025/10/31 12:00:00");
INSERT INTO `v1_75329ac25c60f1e6ab7b07e35bdcdc32615cc1d96a0349050082a8f8467b4d37` VALUES (101, -285.0, 1021101, 0.0, 136402, 7.438, "ユイ", 4, "騎士クンに想いを伝えたい…だから\nミソラちゃん、わたしがんばるね！\n…あれ？　わたし、なんでこんなに\n必死になってるんだろう…？", 10211, "2030/01/01 14:59:59", 61, 3, "2025/11/30 12:00:00");
INSERT INTO `v1_75329ac25c60f1e6ab7b07e35bdcdc32615cc1d96a0349050082a8f8467b4d37` VALUES (201, -285.0, 1021102, 0.0, 136302, 8.35, "ミソラ", 5, "騎士さんとのデートはわたしに\nお任せです★　なのでユイさんは\n安心して計画に専念して…たくさん\nドキドキしちゃってくださいね", 10211, "2030/01/01 14:59:59", 61, 1, "2025/11/30 12:00:00");
INSERT INTO `v1_75329ac25c60f1e6ab7b07e35bdcdc32615cc1d96a0349050082a8f8467b4d37` VALUES (101, -285.0, 1021201, 0.0, 136501, 5.0, "シズル", 2, "新しい年がやってくるね！\nお正月の料理も飾りつけも、\nお姉ちゃんにお任せだよ♪\nみんなで楽しく新年を迎えよう！", 10212, "2030/01/01 14:59:59", 61, 1, "2025/12/31 12:00:00");
INSERT INTO `v1_75329ac25c60f1e6ab7b07e35bdcdc32615cc1d96a0349050082a8f8467b4d37` VALUES (201, -285.0, 1021202, 0.0, 137902, 5.25, "リノ", 2, "おうちの掃除もトラブルも、 \n世界を揺るがす大ピンチも！\n今年のことは今年のうちに \nサッサと片付けちゃいますっ！", 10212, "2030/01/01 14:59:59", 61, 1, "2025/12/31 12:00:00");
INSERT INTO `v1_75329ac25c60f1e6ab7b07e35bdcdc32615cc1d96a0349050082a8f8467b4d37` VALUES (301, -285.0, 1021203, 0.0, 106801, 7.5, "ラビリスタ", 2, "年の瀬はギルドマスターも\nつい駆け回っちゃう忙しい時期だ！\n一年いろいろあったけど\nお互いイイ年を迎えよう、少年！", 10212, "2030/01/01 14:59:59", 61, 1, "2025/12/31 12:00:00");
